import React, { useState } from 'react';

interface RegistrationModalProps {
  isOpen: boolean;
  onClose: () => void;
}

type RegistrationType = 'solo' | 'team';

const initialTeam = Array(7).fill({ name: '', email: '', phone: '' });

export default function RegistrationModal({ isOpen, onClose }: RegistrationModalProps) {
  const [type, setType] = useState<RegistrationType>('solo');
  const [solo, setSolo] = useState({ name: '', email: '', phone: '' });
  const [teamName, setTeamName] = useState('');
  const [team, setTeam] = useState(initialTeam);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  if (!isOpen) return null;

  const handleInput = (e: React.ChangeEvent<HTMLInputElement>, idx?: number) => {
    if (type === 'solo') {
      setSolo({ ...solo, [e.target.name]: e.target.value });
    } else if (typeof idx === 'number') {
      const updated = [...team];
      updated[idx] = { ...updated[idx], [e.target.name]: e.target.value };
      setTeam(updated);
    }
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    if (type === 'solo') {
      if (!solo.name || !solo.email || !solo.phone) {
        setError('Please fill out all fields.');
        return;
      }
      setSuccess('Solo registration submitted!');
      // TODO: Send to backend
    } else {
      if (!teamName) {
        setError('Please enter a team name.');
        return;
      }
      for (let i = 0; i < 7; i++) {
        if (!team[i].name || !team[i].email || !team[i].phone) {
          setError('Please fill out all player fields.');
          return;
        }
      }
      setSuccess('Team registration submitted!');
      // TODO: Send to backend
    }
  };

  return (
    <div className="fixed inset-0 z-50 flex items-center justify-center bg-black bg-opacity-80">
      <div className="bg-gray-900 border-2 border-pumpkin rounded-xl shadow-xl p-6 w-full max-w-md relative">
        <button
          className="absolute top-2 right-2 text-pumpkin hover:text-deeporange text-2xl font-bold"
          onClick={onClose}
          aria-label="Close registration modal"
        >
          Ã—
        </button>
        <h2 className="text-2xl font-bold text-pumpkin mb-4 text-center">Register</h2>
        <div className="flex justify-center mb-4 gap-2">
          <button
            className={`px-4 py-2 rounded font-bold border-2 ${type === 'solo' ? 'bg-pumpkin text-black border-pumpkin' : 'bg-black text-pumpkin border-pumpkin'} transition-colors`}
            onClick={() => setType('solo')}
          >
            Solo
          </button>
          <button
            className={`px-4 py-2 rounded font-bold border-2 ${type === 'team' ? 'bg-pumpkin text-black border-pumpkin' : 'bg-black text-pumpkin border-pumpkin'} transition-colors`}
            onClick={() => setType('team')}
          >
            Team
          </button>
        </div>
        <form onSubmit={handleSubmit} className="space-y-4">
          {type === 'solo' ? (
            <>
              <input
                className="w-full p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                name="name"
                placeholder="Your Name"
                value={solo.name}
                onChange={handleInput}
                autoComplete="name"
              />
              <input
                className="w-full p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                name="email"
                placeholder="Email"
                value={solo.email}
                onChange={handleInput}
                autoComplete="email"
                type="email"
              />
              <input
                className="w-full p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                name="phone"
                placeholder="Phone"
                value={solo.phone}
                onChange={handleInput}
                autoComplete="tel"
                type="tel"
              />
            </>
          ) : (
            <>
              <input
                className="w-full p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                name="teamName"
                placeholder="Team Name"
                value={teamName}
                onChange={e => setTeamName(e.target.value)}
                autoComplete="off"
              />
              {team.map((player, idx) => (
                <div key={idx} className="flex gap-2 mb-2">
                  <input
                    className="flex-1 p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                    name="name"
                    placeholder={`Player ${idx + 1} Name`}
                    value={player.name}
                    onChange={e => handleInput(e, idx)}
                    autoComplete="off"
                  />
                  <input
                    className="flex-1 p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                    name="email"
                    placeholder="Email"
                    value={player.email}
                    onChange={e => handleInput(e, idx)}
                    autoComplete="off"
                    type="email"
                  />
                  <input
                    className="flex-1 p-2 rounded bg-black border border-pumpkin text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-pumpkin"
                    name="phone"
                    placeholder="Phone"
                    value={player.phone}
                    onChange={e => handleInput(e, idx)}
                    autoComplete="off"
                    type="tel"
                  />
                </div>
              ))}
            </>
          )}
          {error && <div className="text-red-400 text-sm text-center">{error}</div>}
          {success && <div className="text-green-400 text-sm text-center">{success}</div>}
          <button
            type="submit"
            className="w-full py-2 rounded bg-pumpkin text-black font-bold hover:bg-deeporange transition-colors mt-2"
          >
            Submit Registration
          </button>
        </form>
      </div>
    </div>
  );
}
